    alignItems="left"
    p={2}
    sx={{
      position: "sticky",
      background: "#000",
      top: 0,
      justifyContent: "space-between",
    }}
  >
    <div style={{ background: "white" }}>Hello</div>
    <div style={{ background: "white" }}>Hello</div>
